  false,\n\t\"url\": null,\n\t\"notes\": \"The Office of National Marine Sanctuaries
  manages a system of sanctuaries and othermanaged areas around the country. The legal
  boundaries of These sanctuaries aredefined within the Code of Federal Regulations,
  at 15 C.F.R. Part 922 and thesubparts for each national marine sanctuary. The GIS
  compatible digital boundaryfiles for each national marine sanctuary are representations
  of those legalboundaries and are based on the best available data. These files are
